INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2011','2011/01/02','2011/11/02',,'http://disqus.com/neque/libero/convallis/eget/eleifend.jsp?consequat=proin&in=risus&consequat=praesent&ut=lectus&nulla=vestibulum&sed=quam&accumsan=sapien&felis=varius&ut=ut&at=blandit&dolor=non&quis=interdum&odio=in&consequat=ante&varius=vestibulum&integer=ante&ac=ipsum&leo=primis&pellentesque=in&ultrices=faucibus&mattis=orci&odio=luctus&donec=et&vitae=ultrices&nisi=posuere&nam=cubilia&ultrices=curae&libero=duis&non=faucibus&mattis=accumsan&pulvinar=odio&nulla=curabitur&pede=convallis&ullamcorper=duis&augue=consequat&a=dui&suscipit=nec&nulla=nisi&elit=volutpat&ac=eleifend&nulla=donec&sed=ut&vel=dolor&enim=morbi&sit=vel&amet=lectus&nunc=in&viverra=quam&dapibus=fringilla&nulla=rhoncus&suscipit=mauris&ligula=enim&in=leo&lacus=rhoncus&curabitur=sed&at=vestibulum&ipsum=sit&ac=amet&tellus=cursus&semper=id&interdum=turpis&mauris=integer&ullamcorper=aliquet&purus=massa&sit=id&amet=lobortis&nulla=convallis&quisque=tortor&arcu=risus&libero=dapibus&rutrum=augue&ac=vel&lobortis=accumsan&vel=tellus','Les conflits peuvent également surgir de traits de personnalités comme les esprits terre-à-terre VS les esprits éclatés, tordus, f**kés! Le pantalon corduroy beige ou le jeans rouge vif? Ou encore les personnalités cérébrales ou plutôt impulsives. On s’imagine mal Denise Bombardier flipper sa maison à grands coups de masse dans les murs! ',NULL);
INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2012','2012/01/02','2012/11/02',,'http://e-recht24.de/non/interdum/in/ante/vestibulum.aspx?odio=molestie&odio=lorem&elementum=quisque&eu=ut&interdum=erat&eu=curabitur&tincidunt=gravida&in=nisi&leo=at&maecenas=nibh&pulvinar=in&lobortis=hac&est=habitasse&phasellus=platea&sit=dictumst&amet=aliquam&erat=augue&nulla=quam&tempus=sollicitudin&vivamus=vitae&in=consectetuer&felis=eget&eu=rutrum&sapien=at&cursus=lorem&vestibulum=integer&proin=tincidunt&eu=ante&mi=vel&nulla=ipsum&ac=praesent&enim=blandit&in=lacinia&tempor=erat&turpis=vestibulum&nec=sed&euismod=magna&scelerisque=at&quam=nunc&turpis=commodo&adipiscing=placerat&lorem=praesent&vitae=blandit&mattis=nam&nibh=nulla&ligula=integer&nec=pede&sem=justo&duis=lacinia&aliquam=eget&convallis=tincidunt&nunc=eget&proin=tempus&at=vel&turpis=pede&a=morbi&pede=porttitor&posuere=lorem&nonummy=id&integer=ligula&non=suspendisse&velit=ornare&donec=consequat&diam=lectus&neque=in&vestibulum=est&eget=risus&vulputate=auctor&ut=sed&ultrices=tristique&vel=in&augue=tempus&vestibulum=sit&ante=amet&ipsum=sem&primis=fusce&in=consequat','Cette année, le Galas Festi rire s’attaquent aux grandes rivalités des Québécois. Évidemment, qui dit rivalités québécoises pense immédiatement à Canadiens VS Nordiques. Non, pas de galas sur ce sujet, le but d’Alain Côté n’était pas bon, fin du débat! Mais cet esprit compétitif a même traversé l’Atlantique avec nos « chers » cousins français! Le Québec vs la France est bel et bien existant. Anne Dorval peut bien avoir pété un plomb sur un plateau de télé français!! Ils nous cherchent!  ',NULL);
