INSERT INTO S_evenement.tblEvenement([nom],[dateDebut],[dateFin],[affiche],[url],[description],[dateSupprime]) VALUES('Festi-rire 2014','2014/01/02','2014/11/02',,'https://icq.com/turpis.html?nam=accumsan&dui=odio&proin=curabitur&leo=convallis&odio=duis&porttitor=consequat&id=dui&consequat=nec&in=nisi&consequat=volutpat&ut=eleifend&nulla=donec&sed=ut&accumsan=dolor&felis=morbi&ut=vel&at=lectus&dolor=in&quis=quam&odio=fringilla&consequat=rhoncus&varius=mauris&integer=enim&ac=leo&leo=rhoncus&pellentesque=sed&ultrices=vestibulum','On a tellement ri l’an dernier qu’on le ramène pour une deuxième édition! Sous la surveillance d’Eddy King à l’animation, le Gala humour de la rentrée 2016 mettra en vedette Didier Lambert, Jay Du Temple, Étienne Dano, Charles Deschamps, Mélanie Ghanimé ainsi qu’un invité surprise. Le spectacle parfait pour bien amorcer la rentrée et commencer son expérience OUMF en beauté!',NULL);
